import React from 'react';
import results from './results'

const Result = (props) => {

    return (
        <div className="gallery">
           {props.movies.map((movies)=>(
                <div>
                    <div>
                    {movies.name}
                    </div>
                    <img src={movies.image.medium} alt="movie"/>
                </div>
            ))}
        </div>
    ); 
};

export default Result;
